import React, { useEffect } from "react";
import { useGlobalContext } from "./Context";

const Stories = () => {
  const context = useGlobalContext();
  const { hits, nbPages } = context;
  return (
    <div>
      <h2>My Tech Posts</h2>
      {hits.map((hit) => {
        const {title, author, objectID, url, num_comments} = hit;
        return (
          <></>
        );
      })}
    </div>
  );
};

export default Stories;
